// src/Cube.js

import React from 'react';
import './Cube.css';

const Cube = ({ color1, color2 }) => {
  return (
    <div className="cube">
      <div className="face front" style={{ backgroundColor: color1 }}></div>
      <div className="face back" style={{ backgroundColor: color2 }}></div>
      <div className="face left" style={{ backgroundColor: color1 }}></div>
      <div className="face right" style={{ backgroundColor: color2 }}></div>
      <div className="face top" style={{ backgroundColor: color1 }}></div>
      <div className="face bottom" style={{ backgroundColor: color2 }}></div>
    </div>
  );
};

export default Cube;
